import React from 'react';
import Manage from '../Manage/Manage';
import { useParams } from "react-router-dom";

function SystemPage(props) {
    const { id } = useParams();

    return (
        <div>
            <u>ניהול</u>
            <Manage systemId={id}/>
        </div>
    );
}

export default SystemPage;
